	"content": "'use strict'\n\nconst http = require('http')\n\nconst stringify = require('.')({\n  type: 'object',\n  properties: {\n    hello: {\n      type: 'string'\n    },\n    data: {\n      type: 'number'\n    },\n    nested: {\n      type: 'object',\n      properties: {\n        more: {\n          type: 'string'\n        }\n      }\n    }\n  }\n})\n\nconst server = http.createServer(handle)\n\nfunction handle (req, res) {\n  const data = {\n    hello: 'world',\n    data: 42,\n    nested: {\n      more: 'data'\n    }\n  }\n  if (req.url === '/JSON') {\n    res.end(JSON.stringify(data))\n  } else {\n    res.end(stringify(data))\n  }\n}\n\nserver.listen(3000)\n",
